        description_en: '<p>The children have no access to safe water, toilets and soap for hand washing at school, or at their homes. Actually, all families in <span class="em">Las Mercedes KM11</span> have to walk half an hour to a <span class="em">water canal</span> to get any water.</p><p><span class="em">But why do they miss school?</span></p>',
        description_es: '<p>Los niños no tienen acceso a agua potable, baños y jabón para lavarse las manos en la escuela o en sus hogares. En realidad, todas las familias de <span class="em">Las Mercedes KM11</span> tienen que caminar media hora a un <span class="em">canal de agua</span> para conseguir agua.</p><p><span class="em">Pero, ¿por qué faltan a la escuela?</span></p>',
