        description_en: '<p>The children have no access to safe water, toilets and soap for hand washing at school, or at their homes. Actually, all families in <span class="em">Totoral Bajo</span> have to walk a few minutes to a <span class="em">water canal</span> to get any water.</p><p><span class="em">But why do they miss school?</span></p>',
