        description_en: '<p>There are only <span class="em">46 children</span> in <span class="em">Totoral Alto</span> and there is no school, so the children go to other communities. They too, are losing almost <span class="em">half a school day</span>, every week!</p><p><span class="em">Why is that?</span></p>',
        description_es: '<p>Solamente hay <span class="em">46 niños</span> en <span class="em">Totoral Alto</span> y no hay ninguna escuela, así que tienen que ir a la escuela en otras comunidades. ¡Ellos también pierden casi <span class="em">medio día</span> de clases cada semana!</p><p><span class="em">¿Por qué es eso?</span></p>',
