        description_en: '<p>It is so simple! Join VAVV team by telling the story of the <span class="em">Totoral Alto</span> children in your class, and perhaps suggest your teacher to create a fundraising campaign to help them!</p><p>We can all be healthy and happy:<br>&quot;<span class="em">True Water True Life.</span>&quot;</p><div class="defs"><div class="row"><div class="col-6"><div class="def"><p>Don’t forget to send us your colored pages of <span class="em">Cerro de Leones</span>!</p><p>We would love to see all your class paintings!</p></div></div></div></div>',
        description_es: '<p>¡Es tan simple! Únase al equipo de VAVV contando la historia de los niños de <span class="em">Totoral Alto</span> en tu clase. ¡Quizás puedas sugerirle a tu maestro que cree una campaña de recaudación de fondos para ayudarlos!</p><p> Todos podemos estar sanos y felices:<br/> &quot;<span class="em">Verdadera Agua Verdadera Vida.</span>&quot;</p><div class="defs"> <div class="row"> <div class="col-6"> <div class="def"> <p>¡No olvides enviarnos tus páginas coloreadas de <span class="em">Cerro de Leones</span>!</p><p>¡Nos encantaría ver todas las pinturas de tu clase!</p></div></div></div></div>',
