        description_en: '<p>The children have no access to safe water, toilets and soap for hand washing at school, or at their homes. Actually, all families in <span class="em">Carrizalillo</span> have to walk a few minutes to a <span class="em">groundwater well</span> to get any water.</p><p><span class="em">But why do they miss school?</span></p>',
        description_es: '<p>Los niños no tienen acceso a agua potable, baños y jabón para lavarse las manos en la escuela o en sus hogares. En realidad, todas las familias de <span class="em">Carrizalillo</span> tienen que caminar unos minutos hasta un <span class="em">pozo de agua subterránea</span> para obtener agua.</p><p><span class="em">Pero, ¿por qué faltan a la escuela?</span></p>',
